class FWDSCErrorWindow extends FWDSCDisplayObject {
  /*
   * Initialize
   */
  constructor(prt) {
    super();
    this.isShowedOnce = false;
    this.prt = prt;
    this.screen.className = "fwdsc-error-window";
    this.style.position = "relative";
    this.style.display = "inline-block";
    this.textDO = new FWDSCDisplayObject();
    this.textDO.style.position = "relative";
    this.textDO.style.display = "inline-block";
    this.textDO.style.wordWrap = "break-word";
    this.textDO.screen.className = "fwdsc-error-window-text";
  }
  /**
   * Show text.
   */
  showText(text) {
    if (!this.isShowedOnce) {
      window.removeEventListener("click", this.close);
      this.close = this.close.bind(this);
      window.addEventListener("click", this.close);
    }
    this.textDO.innerHTML = '<span class="fwdsc-error"></span><span class="fwdsc-error-text">' + text + "</span>";
    this.addChild(this.textDO);
    this.prt.mainDO.addChild(this);
  }
  close() {
    window.removeEventListener("click", this.close);
    this.removeChild(this.textDO);
  }
  /**
   * Destroy
   */
  destroy() {
    if (this.destroyed)
      return;
    this.destroyed = true;
    window.removeEventListener("click", this.close);
  }
}
