    this.planeHeightRatio = this.data.planeHeightRatio;
    if (this.planeWidthRatio) {
      this.planeWidthRatio = parseFloat(this.planeWidthRatio) / 100;
    }
    if (this.planeHeightRatio) {
      this.planeHeightRatio = parseFloat(this.planeHeightRatio) / 100;
    }
    this.planeWidth = this.data.planeWidth;
    this.planeHeight = this.data.planeHeight;
    const planeSizeInPx = FWDSCUtils.getMeshSizeInPX(this.planeWidth, this.planeHeight, this.carouselGeo.z, this.camera, this.renderer);
    this.planeWidthInPx = planeSizeInPx.width;
    this.planeHeightInPx = planeSizeInPx.height;
