        vec3(-7, 1, -1),
        vec3(-1, 1.25, -1.2),
        vec3(-2, -0.5, 2),
        vec3(3, -0.5, 2),
        vec3(2, 1, -1),
        vec3(7, 1, -1),
        // Right extra S-shape (exact mirror of the left extra, without duplicating the join point)
        vec3(10.5, 1.25, -10),
        vec3(14, 1, -8)
