          uMax: { value: 1 - 0.5 / this.numPoints },
          uCtex: { value: tex },
          uTang0: { value: this.curve.getTangent(0) },
          uTang1: { value: this.curve.getTangent(1) },
          uWidth: { value: this.curve.getLength() },
          uShift: { value: this.shift },
          uGap: { value: this.horizontalGap },
          uCenter: { value: this.curveCenter },
          uPosX: { value: index * this.planeWidth },
          uIndex: { value: index },
          uMouse: { value: new Vector2() },
          uHover: { value: 0 },
          uOpacity: { value: 0 },
          uIntroOpacity: { value: 0 },
          uVisibility: { value: 1 },
          uIntroTransition: { value: 1 },
          uTexture: { value: textureData.texture },
          uResolution: { value: new Vector2(this.width, this.height) },
          uQuadSize: { value: new Vector2(this.planeWidthInPx, this.planeHeightInPx) },
