          uReflectionSize: { value: this.reflectionSize },
          uBlurStrength: { value: this.reflectionBlurStrength },
          uDistortion: { value: 0 },
          uCurveDistortionStrength: { value: this.curveDistortionStrength },
          uDistortionTexture: { value: this.displacementTexture },
          uDistortionTextureSize: { value: new Vector2(257, 257) },
          uLiquidDisotrionStrength: { value: this.liquidDistortionStrength }
