    this.lastRotation = { x: 0, y: 0, z: 0 };
    this.carouselMeshGroup.position.x = this.carouselGeo.x;
    this.carouselMeshGroup.position.y = this.carouselGeo.y;
    this.carouselMeshGroup.position.z = this.carouselGeo.z;
